public class LidarProcessor : MonoBehaviour
{
    public GameObject boxPrefab;
    private List<GameObject> boxes = new List<GameObject>();

    [System.Serializable]
    public class CentroidData
    {
        public float[][] centroids; // Now a 2D array: [[x1, y1, z1], [x2, y2, z2], ...]
